The rose 🥀 🌹wilting, prickly, deadly, smothering you with its dozen stems, and in full enticing and seductive bloom
Pleasurable and claustrophobic in equal measure
@noirkeininomiya explores all of those complex facets of this loaded flower and thus transcends from fabric technician to epic emoter with this collection

Running up that windswept hill, tulle skirts hiked up, warm in argyle and balaclavas on, cushions for comfort
@mollygoddard looks to the grit of Thomas Hardy’s Tess Of The D’Urbervilles for an immense show made more effective by a central wind machine runway, blowing up the dresses
Sloooooo-mo required

Warming up to CNY in @ryanlostudio cherry blossom pink 🌸 qipao ensemble against @blenheimpalace ‘s red 🧧damask wallpaper
Come Celebrate China at the pop-up store 
@bicestervillage #BicesterVillage

The bathroom you can’t not photograph 
@mytheresa.com lunch at @annabelsmayfair 
Wearing the most unlikely outfit to be seen in this gaff 😂

Nope, I’m not hyping for the sake of hyping... I really just wanna say these are me in a shoe 
Byeeeeee
@nike x @off____white

“We belong to nobody, and nobody belongs to us. We don't even belong to each other.”
Birdsong, blue skies with cumulus clouds and Audrey Hepburn’s crackled version of Moon River invoking the spirit of Hubert de Givenchy
@clarewaightkeller calls on the forces of nature in an emotive @givenchyofficial #GivenchyCoutureAW18 show

Right Hyères, Right Now Part II “Everybody should have the right to dream and see oneself in a look that defines them.  For me, this collection is for everybody.  Women’s skin and body exist more than ever.”
@estermanas won a special @galerieslafayette prize (like @marineserre_official last year) at #Hyeres33 to create a capsule collection.  Hopefully it stays true to Manas’ approach towards exposing flesh (in all shapes and sizes) as opposed to hiding it.  Don’t call it “plus-size” though.  Manas dreams of creating for everyone from size FR34 to 50...
More on @estermanas and her beautiful “Big Again” collection as part of a #Hyeres33 round-up on the blog ⬆️

Sun seeking begins in Sorrento where I had my first proper crush (Year 10 Latin school trip... was crushed sadly when not reciprocated) 
@prada to the rescue as I’m back in the Amalfi to experience the spirit of  #PradaFragrances #PradaLesInfusions 
Check out Stories for more sun-drenched loveliness ⬆️

“The entire collection is built on the idea of movement and energy.  The frock coats were cut in movement, it swings as you walk and carries its weight in the back making it modern.  We are all constantly on the move, no one sits still - we are all always moving forward.”
@nicolasghesquiere talking about @louisvuitton SS18 for my piece on the collection in @thepopmag 
And finally I got to experience a bit of that 18th century-to-present-day time travel action yesterday as LV closed PFW
